package Print_Star_Pattern;

public class SeriesPrint {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int cnt=10;
				 
		while(cnt<=50)		// 10 < = 50 | 20<=50
		{
			System.out.print(cnt+" ");	// 10  20 
			cnt+=10;
		}
		
		System.out.println("Final Output: "+cnt);
	}

}


//o/p - 10 20 30 40 50 Final Output: 60
